import React from 'react'
import { Route } from 'react-router-dom'
import auth from '../components/SignIn/auth'
export const ProtectedRoute = ({ component: Component, ...rest }) => {

    return (
        <Route {...rest} render={props => {
            return <Component {...props} />
        }} />
    )
}
